css:
.deprecation-cop {
  overflow: auto;
  -webkit-flex: 1;
  background-color: #fdf6e3 !important;
}
.deprecation-cop .deprecation-info {
  padding: 0 10px;
}
.deprecation-cop .deprecation-info:hover {
  background-color: #eee8d5 !important;
}
.deprecation-cop .collapsed > ul {
  display: none;
}
.deprecation-cop .list {
  list-style-type: none;
  padding: 0;
}
.deprecation-cop .stack-trace {
  background-color: #eee8d5;
  padding: 10px;
  margin-bottom: 10px;
}
.deprecation-cop a {
  color: #586e75;
}
